import NavBar from "../Componets/PageComponents/NavBar"
class Home extends Component {


    render(){
  return (
    <div >
        <nav class="navbar sticky-top navbar-light bg-light">
            <a class="navbar-brand" href="#">Sticky top</a>
        </nav>
    </div>
  );
}}

export default Home;
